INSERT INTO `contact` VALUES (65, 'http://img01.02d.com/Public/Upload/image/20190709/5d246160f130a.jpg', 'Dreamcon atti Natural 丝洛深灰→会员专享', 'DIA:14.0 着色：13.3mm 含水量：38% 材质：高级非离子 锁水之王\n混血款黄金比例三色搭配，浅棕色内圈点缀，大面积深灰色覆盖虹膜，搭配外圈的虚拟小黑圈，既不夸张却又迷离', 130.00, 'DREAMCON  ATTI');
INSERT INTO `contact` VALUES (66, 'http://img01.02d.com/Public/Upload/image/20190709/5d246118c3069.jpg', 'Dreamcon atti Natural 亚巧棕→会员专享', 'DIA:14.0 着色：14.3mm 含水量：38% 材质：高级非离子 锁水之王\n橘色系三种颜色渐变层，整体镜片有层次、不突兀，同色系无明显反差色的渐变使得镜片柔和不生硬', 130.00, 'DREAMCON  ATTI');
INSERT INTO `contact` VALUES (67, 'http://img01.02d.com/Public/Upload/image/20190709/5d2460b629d6e.jpg', 'Dreamcon atti Natural 亚蓝灰→会员专享', 'DIA:14.0 着色：14.3mm 含水量：38% 材质：高级非离子 锁水之王\n灰色与淡黑边色素层的包裹宛使得双眸深邃又迷人，纹路的生动逼真仿佛夜空中朦胧的新月', 130.00, 'DREAMCON  ATTI');
INSERT INTO `contact` VALUES (68, 'http://img01.02d.com/Public/Upload/image/20190709/5d246059a4cf5.jpg', 'Dreamcon atti Natural 烟雪奶茶 →会员专享', '：\nDIA:14.0 着色：14.2mm 含水量：38% 材质：高级非离子 锁水之王\n以焦糖的茶褐色由内至外渐变加深，最外圈的虚拟细黑圈让镜片更柔和，不改变瞳孔纹路', 130.00, 'DREAMCON  ATTI');
INSERT INTO `contact` VALUES (69, 'http://img01.02d.com/Public/Upload/image/20190709/5d245f27bbb5c.jpg', 'Dreamcon atti Natural 烟雪灰 →会员专享', 'DIA:14.0 着色：14.2mm 含水量：38% 材质：高级非离子 锁水之王\n紧密排凑的色素颗粒，宛如雪花停留在镜片上，深灰充满了暗抑的美。反复的调色只为更协调的上眼效果', 130.00, 'DREAMCON  ATTI');
INSERT INTO `contact` VALUES (70, 'http://img01.02d.com/Public/Upload/image/20190709/5d245f9d0330a.jpg', 'Dreamcon atti Natural 琉璃灰色 →会员专享', 'DIA:14.0 着色：13.8mm 含水量：38% 材质：高级非离子 锁水之王\n淡雪灰色让眼球更为清透，虚黑边的外包裹增加眼神的聚焦性，避免了传统灰色给人亚健康的尴尬感', 130.00, 'DREAMCON  ATTI');
INSERT INTO `contact` VALUES (71, 'http://img01.02d.com/Public/Upload/image/20190709/5d245f88a9d28.jpg', 'Dreamcon atti Natural 琉璃茶色 →会员专享', 'DIA:14.0 着色：13.8mm 含水量：38% 材质：高级非离子 锁水之王\n经过数次调色之久的花生褐遇上虚黑边的外包裹，黄金比例的染色直径完美包裹瞳孔，避免尴尬的染色面积不够漏出眼白。', 130.00, 'DREAMCON  ATTI');
INSERT INTO `contact` VALUES (72, 'http://img01.02d.com/Public/Upload/image/20190709/5d244959199b5.jpg', 'POEMCON LuckyCharm锦鲤色', '这是什么神仙锦鲤色？\n超有活力的元气少女色\n西柚橘粉颜色搭配非常巧妙\n爆美的蜜桃锦鲤色，素颜戴也不突兀\n完全不用担心日常不合适\n温柔又有元气\n而且效果真的超级美丽\nblingbling女孩必须pick', 150.00, 'POEMCON');
INSERT INTO `contact` VALUES (73, 'http://img01.02d.com/Public/Upload/image/20190709/5d2448ff75f79.jpg', 'POEMCON DarkNight暗夜深灰', '非常显白 一秒点亮肤色\n神秘微混血高级感\n搭配妆容 上镜巨好看\n上眼效果可以高冷也可以可爱 什么类型都可以驾驭\n最重要是颜色不挑人 素颜也能hold住！\n是你值得拥有的高颜值美瞳！\n温柔冷艳又傲娇~', 150.00, 'POEMCON');
INSERT INTO `contact` VALUES (74, 'http://img01.02d.com/Public/Upload/image/20190709/5d24486e184cd.jpg', 'POEMCON DarkNight暗夜浅棕', '偏爱自然心机瞳子的小仙女必入款\n琥珀般惊艳的通透感\n整个眼睛都温柔了起来\n被这么通透的眼珠子迷倒了\n黑色边缘显得深邃有神\n显气质无敌了', 150.00, 'POEMCON');
INSERT INTO `contact` VALUES (75, 'http://img01.02d.com/Public/Upload/image/20190709/5d243f605fe11.jpg', 'POEMCON CoronalIris日冕虹膜', '温柔治愈系眼神 一见心醉\n闭眼入完全不会踩雷的款式\n瞳模小姐姐每天都戴\n让人无法抗拒的一款\n最具特色的自然虹膜款式\n温柔通透超自然\n贴合眼睛虹膜纹理 层次感超强\n做个温柔氧气女神！', 150.00, 'POEMCON');
