INSERT INTO `contact` VALUES (103, 'http://img01.02d.com/Public/Upload/image/20190705/5d1eb6a9a649e.jpg', 'SUNYIOR秀儿JADE BROWN 牛油果绿', '灵气逼人的绿色加上深棕近似黑色的边缘，让瞳孔间有种清冽的效果，不知道自己是在人间还是仙境。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (104, 'http://img01.02d.com/Public/Upload/image/20190704/5d1d6ba0ed43e.png', 'SUNYIOR秀儿 JADE BROWN 牛油果绿', '没有傻白甜的腻，也没有过分的强调甜美而显得矫揉造作的粉质感。来自秀儿的牛油果绿，用清爽的配色技巧代替以花纹为主的传统镜片设计，让你体验到清新而通透的质感。', 130.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (105, 'http://img01.02d.com/Public/Upload/image/20190703/5d1c8b4b6149d.jpg', 'MOUCEE  zing系列木夕绿', '镜片着色采用了迷彩绿色和浅棕色相结合，内圈镭射状花纹设计极大程度的与瞳孔肌理相融合，相比于mori girl系列森屿绿的朝气活泼，木夕绿的花纹和颜色更显内敛、 。', 120.00, 'moucee');
INSERT INTO `contact` VALUES (106, 'http://img01.02d.com/Public/Upload/image/20190703/5d1c8a9043e2f.jpg', 'MOUCEE  zing系列咖啡棕', '含少量有机硅水凝胶材质，使得每一次的佩戴都水润舒适，滋润一整天。如果说纯色的黑显得呆滞，那咖啡棕便是恰到好处，镜片虹膜效果设计', 120.00, 'moucee');
INSERT INTO `contact` VALUES (107, 'http://img01.02d.com/Public/Upload/image/20190703/5d1c8a13caf3e.jpg', 'MOUCEE  zing系列 亚麻灰棕', '（）亚麻色总是时尚的宠儿，这种颜色好像永远都在不过时的热潮中。Zing系列亚麻灰棕配色更偏浅淡，隐约可见的奶白亚麻灰色外圈搭配浅棕内层，上眼显得清透靓丽极衬肤色。', 120.00, 'moucee');
INSERT INTO `contact` VALUES (108, 'http://img01.02d.com/Public/Upload/image/20190703/5d1c894dcc02a.jpg', 'MOUCEE  zing系列 黛青棕', '雨后青蓝的天空，海面波光粼粼，清凉的微风温柔吹过，没有什么比这更舒适了，zing系列黛青棕就是以此为灵感而创作，外圈明显的雾面蓝搭配内圈完美融瞳的浅棕配色堪称高级。', 120.00, 'moucee');
INSERT INTO `contact` VALUES (109, 'http://img01.02d.com/Public/Upload/image/20190703/5d1c877f37d0e.jpg', 'MOUCEE  Mori girl森林女孩系列 森屿绿', '单听这个名字就美到不行，上眼效果也是绝对的好看，浓烈的绿色基底带来绝妙的视觉盛宴，绿色向来都是出挑的颜色，代表着青春，自然之意 。', 120.00, 'moucee');
INSERT INTO `contact` VALUES (110, 'http://img01.02d.com/Public/Upload/image/20190703/5d1c86efc65af.jpg', 'MOUCEE  Mori girl森林女孩系列 璃茉棕', '镜片采用添加少量有机硅高端材质，全天水润透氧舒适，璃茉棕这款镜片内圈保留了与瞳色相近的颜色，外圈墨色的幽深感让瞳孔轮廓更显清晰通透。', 120.00, 'moucee');
INSERT INTO `contact` VALUES (111, 'http://img01.02d.com/Public/Upload/image/20190703/5d1c8595b626f.jpg', 'MOUCEE  Mori girl森林女孩系列 晨曦灰', '清晨当紫色雾霭弥漫在整个森林，视野可见之处，满眼都是紫气缭绕。抬头仰望，天空仿佛也被这“清雾”染成了迷蒙的紫灰色。而这也是mori girl晨曦灰上眼效果取名的由来，将最自然的气息映入你的眼眸', 120.00, 'moucee');
