INSERT INTO `contact` VALUES (240, 'http://img01.02d.com/Public/Upload/image/20190530/5cefa0f9658c6.jpg', 'BOLLY CON MINT VIOLET土星紫', '拥有一半高贵 一半纯情的独特魅力\n从来没有看过如此好看的深遂紫\n2019流行色预言 绝壁是紫灰色呀！\n设计灵感源自 美战水手土星搭配各种眼影都仙\n紫色象征着高贵 毁灭 重生 自信\n  --单只不包邮 ，两只起包邮', 130.00, 'BOLLY CON');
