INSERT INTO `contact` VALUES (322, 'http://img01.02d.com/Public/Upload/image/20190426/5cc29a4e4522c.jpg', 'SUNYIOR秀儿FOGGY PINK  幻月樱粉', '与以往的粉色镜片设计不同，为了确保自然风格，秀儿将粉色与棕色以渲染的工艺完美的过渡。粉色与紫色双色混色边缘，搭配如同云雾般的棕色内部花纹，如同一枚新月下盛开的樱花，宁静地开放在深蓝色的夜色中。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (323, 'http://img01.02d.com/Public/Upload/image/20190426/5cc299cb20e7b.jpg', 'SUNYIOR秀儿FOGGY GRAY 幻月雾灰', '月亮最后升到冷清清的天空，白晃晃一片晶莹，冷冷的光辉照的人间分外白。和以往的设计不同幻月雾灰透漏出清冷的气质，不染纤尘。蝉翼般透明的配色闪着银色的清辉，螺旋的花纹展现出云雾中的朦胧感', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (324, 'http://img01.02d.com/Public/Upload/image/20190426/5cc298fe7fd98.jpg', 'SUNYIOR秀儿FOGGY BROWN 幻月沐棕', '金棕色的月光映着几丝儿羽毛般的轻云，一缕清柔的月光透过窗子，洒在了窗台上，窗台宛若镀了柔柔的金色光辉，\n与市面上绝大多数的棕色镜片不同的是，幻月沐棕的款式并不属于第一眼美人', 150.00, 'SunYior秀儿');
