INSERT INTO `contact` VALUES (702, 'http://img01.02d.com/Public/Upload/image/20181129/5bff4f1e73f59.jpg', 'UMIDO Glasss云烟棕', '深咖色外圈，搭配琥珀棕，让人一眼万年，陷入这暖暖的\n温柔，顾盼流年，眸转千回，上眼后远看自然通透，\n近观温柔宠溺，平时素颜也能hold住，\n喜欢轻混血系的妹子可以看过来！', 200.00, 'UMIDO');
INSERT INTO `contact` VALUES (703, 'http://img01.02d.com/Public/Upload/image/20181129/5bff4e74673cb.jpg', 'UMIDO Glasss云烟蓝', '天冰蓝的色调，整体通透明亮，上眼效果更佳，元气满满，\n被偏爱的瞳孔有恃无恐，让你的眸光永远在闪动。\n时尚混血效果也是爱极了！喜欢的妹子可以搭配一些眼妆，\n约会蹦迪完全slay全场~', 200.00, 'UMIDO');
INSERT INTO `contact` VALUES (704, 'http://img01.02d.com/Public/Upload/image/20181129/5bff4e3b0a927.jpg', 'UMIDO Glasss云烟灰', '气质混血款，黑色外圈加上淡灰色，整体设计简单大方，\n上眼后黑灰交相呼应，格外深邃明亮，时尚感爆棚，\n一点都不死板，小仙女们可以大胆入手，\n平时佩戴可以搭配眼妆，炒鸡fashion~', 200.00, 'UMIDO');
INSERT INTO `contact` VALUES (705, 'http://img01.02d.com/Public/Upload/image/20181129/5bff4c6ca326f.jpg', 'UMIDO Glacier冰川棕', '通过内外圈的交叠，中间过度形成细碎的冰凌纹路，\n采取暖棕色着色，仿佛冬日的冰川被太阳照射，\n寒气里透着温暖。上眼十分自然，\n与瞳孔交融有种猫眼的感觉，通透舒适，\n素颜化妆百搭系列。始于颜值忠于品质！', 200.00, 'UMIDO');
