INSERT INTO `contact` VALUES (742, 'http://img01.02d.com/Public/Upload/image/20181121/5bf55250bef3c.jpg', 'BEESEXY月萤系列', '河中倒映着月影，山边飞淌着流萤。月萤系列营造出的是夏夜的静谧，温和和舒适。\n采自水中月影的金棕色，和飞淌流萤的银灰色，裸双色相辅相成。', 130.00, 'BeeSexy视澳');
INSERT INTO `contact` VALUES (743, 'http://img01.02d.com/Public/Upload/image/20181121/5bf55135d9608.jpg', 'BEESEXY浅沙棕', '相比于晶沫灰，浅沙棕更适合气质温柔的妹子，边缘与瞳色相近的浅黑色，注定让你成为“素颜杀手”，浓郁透亮的棕色以瞳孔为中心呈放射状分布，令双眸看起来更加温柔深邃，撩人心怀。', 130.00, 'BeeSexy视澳');
INSERT INTO `contact` VALUES (744, 'http://img01.02d.com/Public/Upload/image/20181121/5bf55026cd45e.jpg', 'BEESEXY晶沫灰', '摄人心魄的魅惑双眸是哪个女孩不想拥有的呢，那就不要错过这款为你的美丽而生的灰色眼眸吧，晶莹剔透的灰色中，融入了淡雅的棕色，赋予你空灵气质的同时，悄然多了一丝温柔，带给你双重魅力。', 130.00, 'BeeSexy视澳');
INSERT INTO `contact` VALUES (745, 'http://img01.02d.com/Public/Upload/image/20181121/5bf4fb289d210.jpg', 'VSCON 金粉小气泡', '风情万种 妩媚动人\n这款镜片完美演绎了这两个词\n真正做个炫酷的小妖精', 130.00, 'VSCON');
