INSERT INTO `contact` VALUES (748, 'http://img01.02d.com/Public/Upload/image/20181118/5bf120b26e10e.jpg', 'CHIC COCO Pure纯熙棕', '纯棕色融瞳效果一流 打造犹如外国人眼球一般的浅棕混血瞳孔', 150.00, 'Chic Coco');
INSERT INTO `contact` VALUES (749, 'http://img01.02d.com/Public/Upload/image/20181118/5bf11fe090ab1.jpg', 'CHIC COCO Pure纯熙绿', '镜片内里的棕色与眼球色的融为一体 只看到外圈绿色 不增大 极致自然的小心机绿 完全看不出戴了美瞳', 150.00, 'Chic Coco');
