INSERT INTO `contact` VALUES (757, 'http://img01.02d.com/Public/Upload/image/20181117/5bef6912646b0.jpg', 'Holly Girl 夜霭蓝', '像是宇宙星空的设计美感。\n蓝暗色的底片中闪耀着亮黄色纹路，\n就像夜空中点点繁星，宛若置身于浩瀚星河\n，令人无比恬静、徜徉。', 130.00, 'Holly Girl');
INSERT INTO `contact` VALUES (758, 'http://img01.02d.com/Public/Upload/image/20181117/5bef6879855a2.jpg', 'Holly Girl 初霭棕', '以黄昏时的暮霭为设计灵感。\n在底色的选择上选取了明度较低的棕色，\n不规则的边缘设计如同昏黄氤氲的雾气\n在眼中环绕，双眼更加深邃迷人。', 130.00, 'Holly Girl');
INSERT INTO `contact` VALUES (759, 'http://img01.02d.com/Public/Upload/image/20181117/5bef67ff5ab47.jpg', 'Holly Girl 潆羽蓝', '超越常规的超小染色直径——11.8mm\n。虹膜圈部分由自己眼睛本身打造，无限自然的真实视觉感，打造真正的虹膜con\n。小眼姑娘无需担心尺寸，大眼姑娘佩戴更加深邃神秘，大小眼佩戴都魅力无限！', 130.00, 'Holly Girl');
INSERT INTO `contact` VALUES (760, 'http://img01.02d.com/Public/Upload/image/20181117/5bef66ea512aa.jpg', 'Holly Girl 墨尔本蓝', '内圈的淡黄色与主色蓝色融合，\n带点灰调的墨尔本蓝属于最近大热的雾霾蓝调。\n无黑边设计更融瞳，上眼纹路利落分明，\n混血效果浑然天成，小直径更好驾驭～', 130.00, 'Holly Girl');
INSERT INTO `contact` VALUES (761, 'http://img01.02d.com/Public/Upload/image/20181117/5bef657c0aec5.jpg', 'Holly Girl 鹿屿蓝绿', '清新的蓝绿色让人耳目一新。\n内圈以藤蔓状的花纹有活力的延伸，\n多次调色出的蓝绿色特别的深邃迷人\n。上眼后却不夸张的新颖设计，值得你拥有。', 130.00, 'Holly Girl');
INSERT INTO `contact` VALUES (762, 'http://img01.02d.com/Public/Upload/image/20181117/5bef6510f3130.jpg', 'Holly Girl 鹿屿巧灰', '将灰色的高冷神秘与巧色的深邃自然融合。在色调选择上选用较深的灰色\n，并以整齐的巧色外圈与眼白融合，\n更好驾驭的同时保证了提亮和放大双眼的效果。', 130.00, 'Holly Girl');
INSERT INTO `contact` VALUES (763, 'http://img01.02d.com/Public/Upload/image/20181117/5bef644d8a586.jpg', 'Holly Girl 鹿屿粉棕', '粉色在细碎的纹路中与瞳孔底色融合，\n形成温柔的提亮光圈。修饰瞳孔颜色\n浅浅的棕色自然收边，瞳孔放大效果更好，\n打造萌萌哒的小鹿斑比眼\n。搭配甜美的桃花妆，在清爽的初秋时节约会吧！', 130.00, 'Holly Girl');
INSERT INTO `contact` VALUES (764, 'http://img01.02d.com/Public/Upload/image/20181116/5bee274e1c603.jpg', 'SUNYIOR秀儿Cartoon Choco  漫画眼巧克力', '不要有雾，我可以看见海湾尽头有一盏通宵不灭的暖灯与天空明亮的星光相伴。而你，我的女孩在那灯光下的小路上漫无目的走走停停，哀怨可人的脸庞却靓丽照人', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (765, 'http://img01.02d.com/Public/Upload/image/20181116/5bee26b20b250.jpg', 'SUNYIOR秀儿Cartoon Black 漫画眼黑', '我当然不会试图摘星，我要星光奔我而来，所有的光鲜靓丽都敌不过时间，并且一去不复返，而你，我的男孩，可曾看到我还在原地驻足等待。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (766, 'http://img01.02d.com/Public/Upload/image/20181116/5bee25e15953b.jpg', 'SUNYIOR秀儿 爱丽二代巧粉 /ELEGANT II PINK', '整个系列的设计灵感延续ELEGANT1代的典雅，活泼的配色却更显灵动，上眼后的自然感，融化在眼眸之间，\n\n巧粉整体的配色就像包裹进糖纸的草莓巧克力糖果，优雅却不失可爱，软糯软糯的感觉~', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (767, 'http://img01.02d.com/Public/Upload/image/20181116/5bee252e8413e.jpg', 'SUNYIOR秀儿 爱丽二代灰 /ELEGANT II GRAY', '深咖边缘与瞳孔的本色融为一体，渐变的灰色花纹静静的诉说它典雅，极具异域感的灰色，竟然在低调中散发出自然感\n\n就像薄荷糖果一样散发出淡淡清冽的感觉，一丝丝的距离感格外迷人', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (768, 'http://img01.02d.com/Public/Upload/image/20181116/5bee24c5ea376.jpg', 'SUNYIOR秀儿 爱丽二代棕 /ELEGANT II BROWN', '来巧棕和深棕的灵感碰撞 ，三分的甜美七分的纯粹。优雅的深棕作为外圈花纹的颜色让双眸瞬间更显深邃的同时流露出端庄大方的感觉。巧棕的内圈使得整体配色格外俏皮，不落俗套。', 150.00, 'SunYior秀儿');
