INSERT INTO `contact` VALUES (771, 'http://img01.02d.com/Public/Upload/image/20181115/5beced1fdb2b7.jpg', 'SUPER COLOR Vortex珠光旋风', '百媚珠光旋风，独特的螺旋式的纹理设计，\n巧克力搭配金闪微珠光，\n上眼后自然又不失一丝小心机，\n就像眼睛里有星星，布灵布灵一闪一闪的，\n画上眼妆简直是明亮又俏皮的小精灵', 200.00, 'SUPER COLOR');
