INSERT INTO `contact` VALUES (1156, 'http://img01.02d.com/Public/Upload/image/20180207/5a7a9a628c523.jpg', 'AILSALENS噗通噗通少女心系列  珊瑚粉', '粉橘色调少女心的颜色，造自然气质瞳色，非常耐看！戴着是柔柔小女人感，柔柔的粉棕色一年四季佩戴都很好看??暖橘色调的心情呢！甜美的不行！', 150.00, 'AILSALENS');
INSERT INTO `contact` VALUES (1157, 'http://img01.02d.com/Public/Upload/image/20180207/5a7a99ed6e139.jpg', 'AILSALENS噗通噗通少女心系列  珊瑚灰', '雾般朦胧的灰褐色，不会突兀，上眼融合度很好，深瞳色也能驾驭！微混血款，上眼后会被惊艳到！在阳光底下会有种通透的感觉，不会白内障微混血灰调调小直径，素颜都可以完美发挥的天然感灰色！', 150.00, 'AILSALENS');
INSERT INTO `contact` VALUES (1158, 'http://img01.02d.com/Public/Upload/image/20180207/5a7a99734a3ab.jpg', 'AILSALENS噗通噗通少女心系列  珊瑚棕', '珊瑚棕，浅棕色的花纹，花纹小心机，橘棕颜色微混血，不挑人也不夸张，上眼自然超级自然，超级心机！扩瞳效果明显 素颜无压力！甜美又通勤的甜美棕色绝对是人手一副的白搭款式！', 150.00, 'AILSALENS');
INSERT INTO `contact` VALUES (1159, 'http://img01.02d.com/Public/Upload/image/20180207/5a7a8e45bd4b9.jpg', 'AILSALENS噗通噗通少女心系列  蜜糖巧克力', '有层次的巧克力，花纹很通透，利用色彩深浅的过渡还有花纹的交错，\n过渡很自然，这种颜色设计是最适合我们亚洲瞳色的，打造自然明亮的效果果！巧克力色显得很深邃，又有点可爱俏皮！学生党&amp;上班通勤的好搭档哦~', 150.00, 'AILSALENS');
INSERT INTO `contact` VALUES (1160, 'http://img01.02d.com/Public/Upload/image/20180207/5a7a8ce2df1f0.jpg', 'AILSALENS噗通噗通少女心系列  梦幻黑', '素颜也可以驾驭的黑色款，不会显得生硬死板，看起来很萌很可爱\n低调自然的优雅黑，镜片花纹如染料水晕一般，\n常规自然款，素颜好伙伴！', 150.00, 'AILSALENS');
