INSERT INTO `contact` VALUES (1259, 'http://img01.02d.com/Public/Upload/image/20171129/5a1e8d1326026.JPG', 'sunshine-vision烟蕊灰', '烟蕊灰气场独特的花纹 烟雾状的黑灰色调 突然过渡一抹细碎的褐色 仿佛在黑夜中也要璀璨绽放的花蕊 上眼别致有神不突兀 素颜或淡妆都可以轻松驾驭', 110.00, 'sunshine-vision');
INSERT INTO `contact` VALUES (1260, 'http://img01.02d.com/Public/Upload/image/20171128/5a1d424f39c92.jpg', 'sunshine-vision雾绒棕', '雾状朦朦胧胧的丝绒棕色 边缘过渡得自然不死实 上眼效果温柔甜美 有种水汪汪的无辜感 任何场合都百搭的小心机自然款', 110.00, 'sunshine-vision');
INSERT INTO `contact` VALUES (1261, 'http://img01.02d.com/Public/Upload/image/20171128/5a1d40cf92ced.jpg', 'sunshine-vision松鹿', '松鹿松绿棕与鹿茸棕 很柔和的融在一起 就像奈良公园在松树下小憩的小鹿斑比 心旷神怡 整个花纹简约又大气 水汪汪的大直径自然款', 110.00, 'sunshine-vision');
INSERT INTO `contact` VALUES (1262, 'http://img01.02d.com/Public/Upload/image/20171128/5a1d3f33e3ffc.JPG', 'sunshine-vision蜷川实花绿', '与大火的原谅色不同 这款的墨绿色调更接近瞳色 上眼之后温柔日常 内圈浅紫色 搭配墨绿色不规则花瓣状纹路 有种晶莹透亮的水润感 灰绿色外圈锁边 深邃自然 整个花纹精致细腻 却丝毫不突兀', 110.00, 'sunshine-vision');
INSERT INTO `contact` VALUES (1263, 'http://img01.02d.com/Public/Upload/image/20171128/5a1d38426a5b4.JPG', 'sunshine-vision蜷川实花褐', '花色非常特别的轻混血款 点睛的浅紫色内圈 与褐色不规则花瓣状纹路交错 华丽精致 又不失透亮 灰褐色的外圈显得深邃有神 温婉知性的气质 使人过目难忘 搭配淡妆简直美cry', 110.00, 'sunshine-vision');
INSERT INTO `contact` VALUES (1264, 'http://img01.02d.com/Public/Upload/image/20171128/5a1d36c4c4ce6.JPG', 'sunshine-vision蜷川实花棕', '经典琥珀色 深浅不一的三种棕色 由外向内过渡 花瓣状纹路很自然的改变瞳色 上眼甜美温柔不死板 很百搭的日常款 素颜或搭配妆容都很洋气', 110.00, 'sunshine-vision');
INSERT INTO `contact` VALUES (1265, 'http://img01.02d.com/Public/Upload/image/20171128/5a1d3023596a8.JPG', 'sunshine-vision挪威森林', '小清新的日常自然款 墨绿森林外圈 与浅色小雏菊内圈相间 让你如同置身属于自己的那片挪威森林 变成一个俏皮可爱的氧气精灵', 110.00, 'sunshine-vision');
INSERT INTO `contact` VALUES (1266, 'http://img01.02d.com/Public/Upload/image/20171128/5a1d290d8754a.jpg', 'sunshine-vision初恋粉', '温柔的斩男粉咖色 比咖啡色甜美 比粉色自然 如同初恋一般 活泼可爱 甜而不腻 打造不一样的心机自然感', 110.00, 'sunshine-vision');
