INSERT INTO `contact` VALUES (1309, 'http://img01.02d.com/Public/Upload/image/20171101/59f95381b4afc.jpg', 'LUCKY COLOR宝石灰色', '镜片经过加硅处理\n可以让镜片保湿度更高\n双眼就像泡在温泉里\n毫无异物感\n眼睛发干、敏感的妹子\n再也不用担心眼睛发干发涩了\n入眼之后眼睛能舒适一整天', 134.00, 'LUCKY COLOR');
INSERT INTO `contact` VALUES (1310, 'http://img01.02d.com/Public/Upload/image/20171026/59f17d0fb02b5.jpg', 'TreeEye树目SIMPLE清妍棕', '化繁为简，才是大师手段\nSimple系列，把最繁华的棕花融化在瞳色中，变成你的棕色\n看上去繁复的纹路，落入眼中，就是自己的瞳孔自己的色，那么的自然贴切', 120.00, 'TreeEye树目');
INSERT INTO `contact` VALUES (1311, 'http://img01.02d.com/Public/Upload/image/20171026/59f17c204e273.jpg', 'TreeEye树目SIMPLE清妍黑', '最时尚，也是最简单的，极致繁华的黑色，营造的却是最贴近自然的黑色\n这就是Simple系列的终极奥义。让“黑”，演变为美瞳中最时尚的那一款', 120.00, 'TreeEye树目');
INSERT INTO `contact` VALUES (1312, 'http://img01.02d.com/Public/Upload/image/20171026/59f17b41196d6.jpg', 'TreeEye树目ENERGY靓巧', '那是洋溢在眼里的蜜语，弯弯的媚眼\n一展开就是如同巧克力般的甜蜜滋味，是开心\n更是看到对方的甜腻，让那发自内心的感情，感同身受', 120.00, 'TreeEye树目');
INSERT INTO `contact` VALUES (1313, 'http://img01.02d.com/Public/Upload/image/20171026/59f17a2131d4d.jpg', 'TreeEye树目ENERGY粉巧', '那满眼的喜悦之情，近乎溢出眼眸\n那样的姿色，那样的魅力，无关年龄，只关乎你是否开心\n就可以让眼睛都说出愉悦的情意，只为了这一眼', 120.00, 'TreeEye树目');
INSERT INTO `contact` VALUES (1314, 'http://img01.02d.com/Public/Upload/image/20171026/59f1795f6d5ce.jpg', 'TreeEye树目aura 光环棕', '那是大地拢上月光的颜色，是迷雾，是晕染，是别样精致的金色大地\n浅薄的棕色被打上环装的印记，更加凸显的反而是那大地一望无际的无痕渐变，有域，却也遐想无限', 120.00, 'TreeEye树目');
INSERT INTO `contact` VALUES (1315, 'http://img01.02d.com/Public/Upload/image/20171026/59f17870da4a7.jpg', 'TreeEye树目aura 光环绿', '深夜的森林深处，只有月光陪伴蝴蝶飞舞，虽然夜色深沉，你又怎么能说它不是又一出暮色大剧？\n所有的活力，精彩，热闹，在深绿色的背景下，薄薄的光晕染上所有活物，连那绿色精灵都在默默生长', 120.00, 'TreeEye树目');
INSERT INTO `contact` VALUES (1316, 'http://img01.02d.com/Public/Upload/image/20171026/59f175d07ff1f.jpg', 'TreeEye树目aura 光环灰', '好比广寒宫的冷色，是月色，也是孤单，更是故事\n十五的月亮圆又圆，却也是思念的延伸\n在月亮内，有无数的光环，带来了晶莹，又有谁透过晶莹看到了眼底的渴求', 120.00, 'TreeEye树目');
INSERT INTO `contact` VALUES (1317, 'http://img01.02d.com/Public/Upload/image/20171025/59f04066c3892.jpg', 'SunYior秀儿Nude Gray素颜灰', '素颜灰气质独特，使双眼犹如一颗水灵灵的明珠。低调而迷人，高贵且温柔。扑面而来的神秘之感让人无处躲藏', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1318, 'http://img01.02d.com/Public/Upload/image/20171025/59f03f556f35c.jpg', 'SunYior秀儿Brownie Gray棕仙灰', '灰色带来的混血异域气质自不言而喻，而这款棕仙灰在此方面更进一步，不是让你拥有混血的感觉，而是给你天生混血的瞳孔！', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1319, 'http://img01.02d.com/Public/Upload/image/20171025/59f0367bb9aca.jpg', 'SunYior秀儿Basic Choco 经典咖环', '镜片外缘巧克力的边缘与镜片本身的咖啡色自然融合，加之甜美流畅的花纹，立时呈现如水般柔情双眸。半透明的质地给你清爽干净的清透感！咖色温柔，万种风情。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1320, 'http://img01.02d.com/Public/Upload/image/20171020/59e99afef197d.JPG', 'BAMBI SERIES硅水凝胶Glossy棕色', 'Glossy 褐棕色 秋天枫叶的颜色 很特别的颜色\n与眼球融合度超高 秒变混血芭比', 200.00, 'BAMBI SERIES');
INSERT INTO `contact` VALUES (1321, 'http://img01.02d.com/Public/Upload/image/20171020/59e99a2952b06.jpg', 'BAMBI SERIES硅水凝胶Glossy灰色', 'Glossy灰根据俄罗斯妹子瞳孔1:1复制的逼真混血效果款跟以往的混血款\n绝对不一样的感觉亚洲人也能变成外国人', 200.00, 'BAMBI SERIES');
INSERT INTO `contact` VALUES (1322, 'http://img01.02d.com/Public/Upload/image/20171020/59e998fa55754.JPG', 'BAMBI SERIES硅水凝胶Glossy蓝色', 'Glossy天冰蓝的底色搭配仿真的浅花纹，无敌混血款，\n搭配硅水凝胶高透氧材质，全天候水润无压力\n14.5mm大直径，扩瞳效果及好。', 200.00, 'BAMBI SERIES');
