INSERT INTO `contact` VALUES (1412, 'http://img01.02d.com/Public/Upload/image/20170803/5982dfd68d156.jpg', '日本DorisCon strawberry pudding草莓布丁蓝色(硅水凝胶)', '蓝色也变得与众不同，金光闪闪和蓝色的组合一定是非常棒的视觉盛宴！', 228.00, '日本DORISCON');
