INSERT INTO `contact` VALUES (1415, 'http://img01.02d.com/Public/Upload/image/20170803/5982b55895a45.jpg', 'VASSEN非离子氢氧半年抛  V7-2棕', '外圈深咖色，内圈落叶黄色，渐变设计让镜片富有层次感与立体感，佩戴效果透亮，自带微微眼神光，日常通勤款。', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1416, 'http://img01.02d.com/Public/Upload/image/20170803/5982b43575e5a.jpg', 'VASSEN非离子氢氧半年抛  V7-2灰', '灰色轻放射性花纹，外圈黑棕色，显色度刚刚好。聚神又知性的款，视觉上有微微增大眼睛的效果，显白显气质。', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1417, 'http://img01.02d.com/Public/Upload/image/20170803/5982b25e28cfd.jpg', 'VASSEN非离子氢氧半年抛  V5-3棕', '外圈酒红咖色，内圈轻薄金黄色，佩戴后效果是颜色晕染过渡均匀的自然棕色', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1418, 'http://img01.02d.com/Public/Upload/image/20170803/5982b14482a35.jpg', 'VASSEN非离子氢氧半年抛  V5-3灰', '外圈黑灰色，中圈轻薄透亮的灰色，内圈点缀一些金色，特别的设计特别的效果，佩戴效果是微微灰蓝色点缀一丝眼神光，与虹膜颜色相结合显现非常高级的灰色。显白显气质！', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1419, 'http://img01.02d.com/Public/Upload/image/20170803/5982af829a4d0.jpg', 'VASSEN非离子氢氧半年抛  V5-2灰', '这款是简单又低调的灰，知性气质款，日常可佩戴。', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1420, 'http://img01.02d.com/Public/Upload/image/20170803/5982aa011748d.jpg', 'VASSEN非离子氢氧半年抛  V1-1棕色', '聚睛超自然棕褐色，这种颜色很容易让人感觉是混血款，但是这款完全没有那么多混血感，镜片设计比较轻薄，颜色上着色量恰到好处，想要尝试一点混血感但是又找不到太自然的镜片，这款是最佳选择', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1421, 'http://img01.02d.com/Public/Upload/image/20170803/59828def8f56e.jpg', 'VASSEN非离子氢氧半年抛   V1-1绿色', '轻氧绿，超级心水的一款，通透又纯净的绿色，没有过多的修饰，让你在夏日里感到丝丝清凉，轻薄又自在，染色不深不浅恰到好处，营造高级雾面感', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1422, 'http://img01.02d.com/Public/Upload/image/20170803/59828b89345cb.jpg', 'VASSEN非离子氢氧半年抛   V1-1蓝', '这款蓝色类似马尔代夫海的颜色，在混血款中，它显色恰到好处', 75.00, 'VASSEN');
INSERT INTO `contact` VALUES (1423, 'http://img01.02d.com/Public/Upload/image/20170802/59816181cb099.jpg', 'SunYior秀儿Canvas渲彩巧棕', '不同色彩间的随意点缀更是像极了文艺复兴时兴起的渲染技法，佩戴后在双眸中若隐若现的黄光芒仿佛微微燃起的火焰，让双眸生动而又自然灵气，撩人心动。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1424, 'http://img01.02d.com/Public/Upload/image/20170802/59816083b04cd.jpg', 'SunYior秀儿Canvas渲彩蓝绿', '这款主打欧美风格的款式，\n色彩基调选用了充满生机的蓝、绿两色，加之渲彩工艺的设计，\n佩戴之后的眼眸便如同银河系般深邃，一眼望不到尽头。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1425, 'http://img01.02d.com/Public/Upload/image/20170802/59815edbc293d.jpg', 'SunYior秀儿Canvas渲彩灰褐', '渲彩灰褐的设计灵感来源于琥珀，介于黄色咖啡色之间的琥珀有着一种柔和的光泽，而这款渲彩灰褐中心颜色便是标准的琥珀色。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1426, 'http://img01.02d.com/Public/Upload/image/20170802/59815d064f617.jpg', 'SunYior秀儿 Amethyst水晶紫巧', '水晶紫巧这款产品的设计灵感源于生活，\n棕色的光泽像是阳光照耀下的新鲜摩卡，\n深邃的外环颜色在放大眼球的同时更是显示出明晰透亮的感觉，\n镜片边缘零零落落的紫色光芒仿若夜空零零点点的微星，\n朦胧之际又令人向往', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1427, 'http://img01.02d.com/Public/Upload/image/20171010/59dc770d8f21e.jpg', 'I-DOL ICOLOR三色灰 SHERBET 3COLOR BLueGray', '混血范十足，个性气质利器，混搭控专用款，演绎率性风尚', 150.00, 'I-DOL');
INSERT INTO `contact` VALUES (1428, 'http://img01.02d.com/Public/Upload/image/20171010/59dc7726bf86c.jpg', 'I-DOL ICOLOR三色棕 SHERBET 3COLOR BrownishPink', '让您尽情绽放魅力双眸，展现个性自我，关键时刻眼神不NG。 \n时尚而颇具真实感的棕色为您的眼睛分外增添混血美感，让双眸更富灵性，水润而光亮。', 150.00, 'I-DOL');
INSERT INTO `contact` VALUES (1429, 'http://img01.02d.com/Public/Upload/image/20171010/59dc77492a0fc.jpg', 'I-DOL ICOLOR FAIRY BluePurple', '恰到好处的紫色点缀，高贵典雅的象征，拥有着非凡的地位.\n是一款充满灵性梦幻感觉的美瞳', 150.00, 'I-DOL');
