INSERT INTO `contact` VALUES (1441, 'http://img01.02d.com/Public/Upload/image/20170720/59703947d6eee.jpg', 'AILSALENS TEA milk tea', '伴着冰块的奶茶，在那香气中我闻到了思念的味道，在那水雾里我看到了你的笑脸！浅尝一口，满心芳甜，灰咖色外圈+灰色内圈+金色珠光，硅水凝胶材质佩戴一天也舒服水润！', 150.00, 'AILSALENS');
INSERT INTO `contact` VALUES (1442, 'http://img01.02d.com/Public/Upload/image/20170720/597036c20c34f.jpg', 'AILSALENS TEA mango tea', '芒果金黄色外表，在阳光的照耀下金灿灿的，让人谗言欲滴。熟透的果肉好像染了金色的棉花糖，轻配上清爽味甜的红茶，咖色外圈+黄棕内圈+金色珠光，硅水凝胶材质佩戴一天也舒服水润！', 150.00, 'AILSALENS');
INSERT INTO `contact` VALUES (1443, 'http://img01.02d.com/Public/Upload/image/20170720/5970358c30fc4.jpg', 'AILSALENS TEA berry tea', '红红的莓果香甜、貌美，温温润润、软软绵绵、柔柔韧韧，吃到嘴里是淡淡的酸、淡淡的甜、淡淡的香。让人忍不住尝了又尝，粉咖色外圈+粉色内圈+银色珠光，硅水凝胶材质佩戴一天也舒服水润！', 150.00, 'AILSALENS');
INSERT INTO `contact` VALUES (1444, 'http://img01.02d.com/Public/Upload/image/20170719/596ed26c31065.jpg', 'SunYior秀儿棕仙', '经典棕仙，至纯至臻。优雅中流露妩媚，庄重中透出性感。14.0直径亦可打造自然美眸。值得珍视，亦值得拥有。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1445, 'http://img01.02d.com/Public/Upload/image/20170719/596ed1b3a2020.jpg', 'SunYior秀儿素颜棕', '清新，自然，拒绝繁复。由内而外的典雅棕色，带来无与伦比的感受，为您打造柔美亮丽的双眸。简单也可以很美丽，素颜也可以有魅力！', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1446, 'http://img01.02d.com/Public/Upload/image/20170719/596ed0dc4aae1.jpg', 'SunYior秀儿经典黑环', '黑色的梦幻，黑色的神秘，黑色的庄重，凝于潋滟的眸光。极简的外观，极致的内涵，高雅中亦可流露伶俐与生动。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1447, 'http://img01.02d.com/Public/Upload/image/20170719/596ed02d2c6af.jpg', 'SunYior秀儿混血女王棕', '无黑边缘设计，成就自然与纯粹；灰色环状花纹与棕色点状内心完美贴合，流露异域浓情。东方的含蓄优雅，西方的热情奔放，顷刻间凝于双眸。混血女王，你也可以拥有。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1448, 'http://img01.02d.com/Public/Upload/image/20170719/596ecec33180b.jpg', 'SunYior秀儿混血女王灰', '无黑边缘，打造自然风尚；典雅青灰，流露无限光芒。东方的自然华美，西方的高调张扬，就在这里融合。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1449, 'http://img01.02d.com/Public/Upload/image/20170719/596ecd6396eb7.jpg', 'SunYior秀儿爱丽棕环', '优雅，知性，甜美。深咖边缘与棕色内环的自然融合，成就别样魅力。举手投足间，流露女神般的高贵与典雅。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1450, 'http://img01.02d.com/Public/Upload/image/20170719/596ecc2422db6.jpg', 'SunYior秀儿爱丽灰环', '深咖边缘与本色融为一体，渐变的灰色环内花纹尽情彰显典雅内涵，让您即刻拥有流彩的目光。小直径款，低调灰环，时尚气息的使者，杂志封面的最爱。', 150.00, 'SunYior秀儿');
INSERT INTO `contact` VALUES (1451, 'http://img01.02d.com/Public/Upload/image/20170719/596ecaa6e6f47.jpg', 'SunYior秀儿日暮巧克力', '细腻精巧的颜色搭配，似红酒与巧克力的完美融合。荣耀与奢华尽显，尊贵与显赫并存。14.0直径中的珍品。自然的明眸效果，至臻的表达方式，女神，不再是遥不可及的梦。', 150.00, 'SunYior秀儿');
